records.addlTxt:
Defendant in custody on WRIT.
The State moves to delete the enhancer on count 1.  Motion granted.
GUILTY plea entered to the amended charge in count 1, deliver heroin.  Convicted.
The State moves to dismiss and read in count 2.  Motion granted.
Sentence is withheld and the defendant is placed on probation to DOC for three (3) years, consecutive to the prison sentence the defendant is presently serving on Ozaukee County cases 16 CF 76 and 15 CF 282 and Sheboygan County case 15 CF 629, to commence upon defendants discharge date after extended supervision ends.
Conditions of probation:
1) Pay court costs including $180.00 buy money to Metro Drug;
2) pay supervision fees in an amount to be determined by DOC;
3) provide DNA sample;
4) Submit to random urine screens and pay for same;
5) Maintain fulltime employment, schooling, work search or combination;
6)\ Maintain absolute sobriety;
7) AODA assessment and follow through and assessment, treatment, counseling as deemed appropriate by the Departments assessment process; if the agent deems necessary;
8) Any counseling or treatment if agent deems appropriate;
9) Have no contact with any known drug users or dealers.
Minutes.
